import React, { Component } from "react";
import "./App.css";
import "./styles/WhyOla.css"
export default class Fleet extends Component {
    render() {

        return (

            <div>
                <div>
                    <h2 style={{ margin: "30px 0 -30px 0px", color: "black" }}>Meet our Awesome Fleet</h2>
                    <br />
                    <h5 style={{ marginLeft: "0px", color: "rgba(0, 0, 0, 0.92)", opacity: "0.5" }}>The widest variety of cars to choose from </h5>

                <div className="bind" style={{ backgroundColor: "white", position :"relative" }}>
                        <div style={{ backgroundColor: "white" }}><img style={{ width: "40%", height: "auto", top: "2px", position: "relative", paddingBottom: "-10px", paddingRight: "-20px" }} src="https://cms-web.olacabs.com/00000000368.jpg" ></img>

                            <div style={{ float: "right", backgroundColor: "white", width: "27%", height: "auto" }}>
                                <h3>Cabs for Every Pocket </h3>
                                <p style={{ color: "black" }}>
                                    From Sedans and SUVs to Luxury cars for special occasions, we have cabs to suit every pocket
                             </p>
                            </div>


                            </div></div>

                </div>
            </div>

        );
    }


}
